DROP table  `SOLAR_SCHEDULE`;
create table  `SOLAR_SCHEDULE`
(
    ID               int auto_increment
        primary key,
    MONTH            int                  not null,
    HOUR             int                  not null,
    MINUTE           int                  not null,
    DAY              int                  not null,
    POSITION         int                  not null,
    IGNORE_DAY_LIGHT tinyint(1) default 0 not null
)
    engine = MyISAM
    charset = utf8mb4;

